      out.write("\t\t\t\t\t\t\t\t\t\t\t\t//본 예제에서는 도로명 주소 표기 방식에 대한 법령에 따라, 내려오는 데이터를 조합하여 올바른 주소를 구성하는 방법을 설명합니다.\n");
      out.write("\t\t\t\t\t\t\t\t\t\t\t\tfunction sample4_execDaumPostcode() {\n");
      out.write("\t\t\t\t\t\t\t\t\t\t\t\t\tnew daum.Postcode(\n");
