      out.write("\t\t\t\t\t\t\n");
      out.write("\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t// 법정동명이 있을 경우 추가한다. (법정리는 제외)\n");
      out.write("\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t// 법정동의 경우 마지막 문자가 \"동/로/가\"로 끝난다.\n");
